if(!function_exists('get_latest_events'))
{
    function get_latest_events()
    {
        global $mysqli;

        if(!$mysqli)
            return false;

        $query = $mysqli->prepare("SELECT * FROM (SELECT *, UNIX_TIMESTAMP(post_time) AS post_time FROM wp_events ORDER BY post_time DESC LIMIT 0, 5) AS t");

        $query->execute();
        $query->bind_result($event_id, $title, $type, $timestamp, $location, $description);
        while ($query->fetch())
        {
            echo '<div class="events">';
            echo '<div class="event-details">';
            echo '<a href="index.php?page='.__('events.php').'&event='.$event_id.'">';
            echo '<h5>';
            echo strip_tags($title);
            echo '</h5>';
            echo '<p class="event-date">';
            echo '<a href="index.php?page='.__('events.php').'&event='.$event_id.'">'.get_the_date('j.n.Y', $timestamp).'</a>';
            echo '</p></div>';

            echo '<div class="event-content">';
            echo $description;
            echo '</div>';
            echo '</div>';
        }

        $query->close();

        return true;
    }
}

