class cWebpage{

	public static function cWebpage($page) {
		if (file_exists("cache/" . $page)) {
			include("cache/" . $page);
			return false;
		} else {
			echo("<meta http-equiv='Content-Type' content='text/html; charset=iso-8859-15' />");
			include("./include/$page");
			return true;
		}
	}

	public static function cWebpageJson($page) {
		$root = new stdClass();
		if (file_exists("cache/" . $page)) {
			$root = include("cache/" . $page);
			return $root;
		} else {
			header("Content-Type: application/json");
			include("./include/$page");
			return $root;
		}
	}

	public static function cWebpageHtml($page) {
		if (file_exists("cache/" . $page)) {
			include("cache/" . $page);
			return false;
		} else {
			echo("<meta http-equiv='Content-Type' content='text/html; charset=iso-8859-15' />");
			include("./include/$page");
			return true;
		}
	}

	public static function getPage($page) {
		if (file_exists("cache/" . $page)) {
			return include("cache/" . $page);
		} else {
			include("./include/$page");
			return false;
		}
	}

	public static function getPageJson($page) {
		return array(
			"error" => 0,
			"data" => self::getPage($page)
		);
	}

	public static function getPageHtml($page) {
		if (file_exists("cache/" . $page)) {
			include("cache/" . $page);
			return false;
		} else {
			include("./include/$page");
			return true;
		}
	}

